import React from 'react';
import Card from '../Card/Card';
import './CardGrid.css';

const CardGrid = (props)  => {

  console.log("CardGrid FCD ",props.forecast); 
  if(props.forecast){
    console.log("CardGrid FCD ",props.forecast.forecastday);   
  }

  return (

      <div className="card-grid">
         <Card/>
         <Card/>
      </div>
    );
  }

  export default CardGrid;
